import React, { useEffect, useState } from 'react';
import { fetchOrders } from '../services/api';
import '../components/Cart.css';

const Orders = () => {
    const [orders, setOrders] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        const getOrders = async () => {
            try {
                setLoading(true);
                const fetchedOrders = await fetchOrders();
                setOrders(fetchedOrders);
            } catch (err) {
                setError('Failed to load orders');
                console.error('Error fetching orders:', err);
            } finally {
                setLoading(false);
            }
        };

        getOrders();
    }, []);

    if (loading) {
        return <div style={{ textAlign: 'center', padding: '40px' }}>Loading orders...</div>;
    }

    return (
        <div className="cart-container">
            <h2>Your Orders</h2>

            {error && <div style={{ color: 'red', padding: '10px', marginBottom: '20px' }}>{error}</div>}

            {orders.length === 0 ? (
                <p className="empty-cart">No orders found. Start by placing an order!</p>
            ) : (
                <div style={{ display: 'flex', flexDirection: 'column', gap: '20px' }}>
                    {orders.map(order => (
                        <div key={order._id} style={{
                            border: '1px solid #ddd',
                            padding: '20px',
                            borderRadius: '8px',
                            backgroundColor: '#f9f9f9'
                        }}>
                            <div style={{ marginBottom: '15px' }}>
                                <h3>Order #{order._id}</h3>
                                <p><strong>Status:</strong> <span style={{ color: order.status === 'Pending' ? '#ff9800' : '#4caf50' }}>{order.status}</span></p>
                                <p><strong>Date:</strong> {new Date(order.orderDate || order.createdAt).toLocaleDateString()}</p>
                            </div>

                            <div style={{ marginBottom: '15px' }}>
                                <h4>Delivery Details</h4>
                                <p><strong>Name:</strong> {order.customerName}</p>
                                <p><strong>Contact:</strong> {order.contactNo}</p>
                                <p><strong>Address:</strong> {order.address}</p>
                            </div>

                            <div style={{ marginBottom: '15px' }}>
                                <h4>Items Ordered</h4>
                                {order.items && order.items.length > 0 ? (
                                    <ul style={{ paddingLeft: '20px' }}>
                                        {order.items.map((item, idx) => (
                                            <li key={idx}>
                                                {item.pizzaName} x {item.quantity} = ₹{item.price * item.quantity}
                                            </li>
                                        ))}
                                    </ul>
                                ) : (
                                    <p>No items in this order</p>
                                )}
                            </div>

                            <div style={{
                                backgroundColor: '#fff',
                                padding: '15px',
                                borderRadius: '4px',
                                borderTop: '2px solid #ddd'
                            }}>
                                <div style={{ display: 'flex', justifyContent: 'space-between', fontWeight: 'bold' }}>
                                    <span>Total Amount:</span>
                                    <span style={{ color: '#ff6b6b', fontSize: '18px' }}>₹{order.totalAmount}</span>
                                </div>
                                {order.paymentMethod && (
                                    <div style={{ marginTop: '10px', fontSize: '14px', color: '#666' }}>
                                        <strong>Payment Method:</strong> {order.paymentMethod}
                                    </div>
                                )}
                            </div>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
};

export default Orders;
